const Episodes = ({ chapter }) => {
    //console.log(props)
    const renderEpisodes = () => {
        return listChapter.map((chapter, i) => {
            if (chapter.completed) {
                return <article key={i}> <h4 className="tachado"> {chapter.task}</h4></article>
            } else {
                return <article key={i}> <h4> {chapter.task}</h4></article>
            }
        }
        )
    }
    return <div>
        {renderEpisodes()}
    </div>
}
